import React from "react";

const VideoCard = ({ video, onClick }) => {
  const thumbnail =
    video.videos.large?.thumbnail ||
    video.videos.medium?.thumbnail ||
    video.videos.small?.thumbnail ||
    video.videos.tiny?.thumbnail;

  return (
    <div
      className="max-w-sm rounded overflow-hidden shadow-lg"
      onClick={() => onClick(video)}
    >
      <img className="w-full" src={thumbnail} alt={video.tags} />
      <div className="px-6 py-4">
        <div className="font-bold text-xl mb-2">{video.user}</div>
        <p className="text-gray-700 text-base">{video.tags}</p>
      </div>
    </div>
  );
};

export default VideoCard;
